import React from 'react';
import './header.css';
import { Nav, Navbar, NavDropdown } from 'react-bootstrap'
import logo from './logo.png'
  const Header = () => {
 
  return (
    <>
      <div className="Header">
      <Navbar.Brand>
          <img src={logo} width="80px" height="40px" />{' '}
    
        </Navbar.Brand>
      </div>
    </>
  );
};

export default Header;
